       body {

       }
       @-webkit-keyframes rotate-center {
           0% {
               transform: rotate(0);
           }
           20% {
               transform: rotate(0);
           }
           100% {
               transform: rotate(720deg);
           }
       }
       @keyframes rotate-center {
           0% {
               transform: rotate(0);
           }
           20% {
               transform: rotate(0);
           }
           100% {
               transform: rotate(720deg);
           }
       }
       ::-webkit-scrollbar {
           width: 4px;
           height: 4px;
       }
       ::-webkit-scrollbar-track {
           border-radius: 11px;
       }
       ::-webkit-scrollbar-thumb {
           background: rgba(233, 244, 255, 0.13);
       }
       ::-webkit-scrollbar-thumb:hover {
           background: #555;
       }
       #masterLoader {
           height: 100vh;
           width: 100vw;
           display: flex;
           align-items: center;
			  position: fixed;
			  z-index: 999999;
           background-color: #191a1c;
       }
       #masterLoader app-loader {
           width: auto;
           height: 15vh;
           display: flex;
           flex-grow: 1;
           flex-direction: column;
           align-items: center;
           margin-bottom: 15vh;
       }
		 .logo-rotate .border {
           width: 100%;
           height: auto;
           color: #2D3138;
       }
		 .logo-rotate .center-wrap {
           position: absolute;
           top: 0;
           left: 0;
           width: 100%;
           height: 100%;
           display: flex;
           align-items: center;
           justify-content: center;
           transform: translateY(-5%);

       }
		 .logo-rotate .center-wrap .center {
           width: 55%;
           height: 55%;
           animation: rotate-center 2s ease-in-out infinite both;
       }
       .logo-rotate {
           position: relative;
           height: 100%;
           display: flex;
       }
